for(let i = 0; i < ballCount; i++) {
  const imageUrl = imageUrls[Math.floor(Math.random() * imageUrls.length)];
  targetElement.innerHTML += `<div class="ball" id="ball${i}" style="background-image: url('${imageUrl}');"></div>`;
}

targetElement.innerHTML += `</body>`;

document.body.appendChild(targetElement);

function moveElement() {
  for(let i = 0; i < ballCount; i++) {
    const ballElement = document.getElementById(`ball${i}`);
    const x = Math.random() * (window.innerWidth - 100);
    const y = Math.random() * (window.innerHeight - 100);
    ballElement.style.transform = `translate(${x}px, ${y}px)`;
  }
}

setInterval(moveElement, 900);

